create table cars (
    car varchar(100),
    category varchar(100),
    primary key (car)
  );




create table regions (
   region_id int,
   region varchar(40),
   primary key (region_id)
  );



create table sellers (
	seller_id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	selling_date DATE,
	car VARCHAR(17),
	gender VARCHAR(1),
	price INT,
	region_id INT,
	primary key (seller_id)
);




